    description
}: ICard){

    return (
            <CardContainer>

            {children} 
            <h3> {title} </h3>
            <p> {description} </p>

            <PlayerDiv> 
                <img  className="play" src={PlayIcon }/ >
            </PlayerDiv>

            </CardContainer>
    )
}
